import React from 'react';
import {
  Card,
  Typography,
  Avatar,
  Box,
  Grid,
} from '@mui/material';

const RUNE_STYLE_NAMES = {
  8100: 'Domination',
  8300: 'Inspiration',
  8000: 'Precision',
  8400: 'Resolve',
  8200: 'Sorcery',
};

const RUNE_PERK_NAMES = {
  8112: 'Electrocute',
  8124: 'Predator',
  8128: 'DarkHarvest',
  9923: 'HailOfBlades',
  8351: 'GlacialAugment',
  8360: 'UnsealedSpellbook',
  8005: 'PressTheAttack',
  8008: 'LethalTempo',
  8021: 'FleetFootwork',
  8010: 'Conqueror',
  8437: 'GraspOfTheUndying',
  8439: 'Aftershock',
  8465: 'Guardian',
  8214: 'SummonAery',
  8229: 'ArcaneComet',
  8230: 'PhaseRush',
};

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells = [],
    runes = [],
    participants = [],
    version = "14.21.1",
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const matchBgColor = win ? '#1a73e8' : '#d32f2f';

  const championImage = (
    <Avatar
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
      alt={champion}
      sx={{ width: 48, height: 48, borderRadius: '8px' }}
    />
  );

  const itemImages = items
    .filter((itemId) => itemId > 0)
    .map((itemId, index) => (
      <Avatar
        key={`item-${itemId}-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`}
        alt={`Item ${itemId}`}
        sx={{ width: 24, height: 24, mr: 0.5, borderRadius: '4px', bgcolor: '#2d3748' }}
        variant="rounded"
      />
    ));

  const spellImages = summonerSpells.map((spellName, index) => (
    <Avatar
      key={`spell-${spellName}-${index}`}
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`}
      alt={`Spell ${spellName}`}
      sx={{ width: 24, height: 24, mr: 0.5, borderRadius: '4px', bgcolor: '#2d3748' }}
      variant="rounded"
    />
  ));

  const runeImages = runes.map((runeStyle, index) => {
    const styleName = RUNE_STYLE_NAMES[runeStyle.style] || 'Unknown';
    const perkName = RUNE_PERK_NAMES[runeStyle.selections[0]?.perk] || 'Unknown';

    return (
      <Avatar
        key={`rune-${index}`}
        src={`https://ddragon.leagueoflegends.com/cdn/img/perk-images/Styles/${styleName}/${perkName}/${perkName}.png`}
        alt={`Rune ${styleName}`}
        sx={{ width: 24, height: 24, mr: 0.5, borderRadius: '4px', bgcolor: '#2d3748' }}
        variant="rounded"
      />
    );
  });

  const team1Details = participants.slice(0, 5).map((participant, index) => (
    <Box key={`team1-participant-${index}`} display="flex" alignItems="center" mb={0.5}>
      <Avatar
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
        alt={participant.championName}
        sx={{ width: 20, height: 20, mr: 0.5 }}
      />
      <Typography variant="caption" color="#f0f0f0">{participant.summonerName}</Typography>
    </Box>
  ));

  const team2Details = participants.slice(5, 10).map((participant, index) => (
    <Box key={`team2-participant-${index}`} display="flex" alignItems="center" mb={0.5}>
      <Avatar
        src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
        alt={participant.championName}
        sx={{ width: 20, height: 20, mr: 0.5 }}
      />
      <Typography variant="caption" color="#f0f0f0">{participant.summonerName}</Typography>
    </Box>
  ));

  return (
    <Card
      variant="outlined"
      sx={{
        mb: 1,
        backgroundColor: matchBgColor,
        color: '#f0f0f0',
        boxShadow: 4,
        borderRadius: 2,
        p: 1,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
      }}
    >
      <Box sx={{ display: 'flex', alignItems: 'center', flex: 1 }}>
        <Box display="flex" flexDirection="column" alignItems="center" mr={2}>
          {championImage}
        </Box>
        <Box display="flex" flexDirection="column">
          <Typography variant="body1" fontWeight="bold" color="#f0f0f0">
            {matchOutcome}
          </Typography>
          <Typography variant="body2" color="#f0f0f0">
            {kills}/{deaths}/{assists} K/D/A
          </Typography>
          <Typography variant="caption" color="#a0aec0">
            {gameDuration}
          </Typography>

          <Box display="flex" justifyContent="flex-start" alignItems="center" flexWrap="wrap" gap={0.5} mt={1}>
            {spellImages}
            {runeImages}
            {itemImages}
          </Box>
        </Box>
      </Box>
      <Box display="flex" flexDirection="column" minWidth="150px" textAlign="right">
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography variant="caption" color="#f0f0f0" fontWeight="bold">
              Team 1:
            </Typography>
            {team1Details}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="caption" color="#f0f0f0" fontWeight="bold">
              Team 2:
            </Typography>
            {team2Details}
          </Grid>
        </Grid>
      </Box>
    </Card>
  );
}

export default Match;
